INSERT INTO `papers` VALUES ('1473733248646',1,0,'On Retention of Eventual Stability of Perturbed Impulsive Differential Systems','In this paper, a system of non nonlinear differential equations with\r\nimpulse effect at fixed time moments is considered and criteria for retention of\r\nuniform eventual stability of its perturbed impulsive differential systems under\r\nvanishing perturbations are established. Sufficient conditions are obtained by\r\nusing piecewise continuous Lyapunov functions. An example is also worked out\r\nto illustrate the results.',2016,'95','1-11',48,1,'Journal of Mathematical and Fundamental Sciences','','',1,0,NULL,'2016-09-12 12:05:57',NULL,NULL,0,'2016-09-12 12:05:57',''),('1473735292322',1,0,'Growth Rates Analysis of Porites Corals from Nusa Penida, Bali','The annual growth of Porites coral is represented by a pair of\r\nhigh- and low-density bands. Environmental changes in the ambient waters\r\ninfluence the pattern of these annual density bands. Five colonies of Porites\r\ncorals from Nusa Penida, Bali were investigated to analyze their annual\r\nlinear growth rates using coral densitometry. From the analysis it was found\r\nthat the annual linear growth rates of the colonies varied between 0.8924 to\r\n1.0012 cm/yr. The trends of the colonies growth rates also varied. Two\r\ncolonies showed a decreasing trend, while the others showed an increasing\r\ntrend. The annual linear growth rates of most of the colonies were not\r\ninfluenced by sea surface temperature (SST); only one out of five colonies\r\nhad a significant correlation with SST (R = 0.66, p-value < 0.05)',2016,'95','12-24',48,1,'Journal of Mathematical and Fundamental Sciences','','',1,0,NULL,'2016-09-12 19:54:52',NULL,NULL,0,'2016-09-12 19:54:52',''),('1473740506632',1,0,'Approximate Solutions of Linearized Delay Differential Equations Arising from a Microbial Fermentation Process Using the Matrix Lambert Function','In this paper we present approximate solutions of linearized delay\r\ndifferential equations using the matrix Lambert function. The equations arise\r\nfrom a microbial fermentation process in a metabolic system. The delay term\r\nappears due to the existence of a rate-limiting step in the fermentation pathway.\r\nWe find that approximate solutions can be written as a linear combination of the\r\nLambert function solutions in all branches. Simulations are presented for three\r\ncases of the ratio of the rate of glucose supply to the maximum reaction rate of\r\nthe enzyme that experienced delay. The simulations are worked out by taking the\r\nprincipal branch of the matrix Lambert function as the most dominant mode. Our\r\npresent numerical results show that the zeroth mode approach is quite reliable\r\ncompared to the results given by classical numerical simulations using the\r\nRunge-Kutta method.',2016,'95','25-38',48,1,'Journal of Mathematical and Fundamental Sciences','','',1,0,NULL,'2016-09-12 21:21:47',NULL,NULL,0,'2016-09-12 21:21:47',''),('1473741298680',1,0,'Trees with Certain Locating-Chromatic Number','The locating-chromatic number of a graph ',2016,'95','39-47',48,1,'Journal of Mathematical and Fundamental Sciences','','',1,0,NULL,'2016-09-12 21:34:59',NULL,NULL,0,'2016-09-12 21:34:59',''),('1473748417829',1,0,'Influence of Various Precursor Compositions and Substrate Angles on ZnO Nanorod Morphology Growth by Aqueous Solution Method','ZnO nanorods were synthesized on silicon wafer substrate with a seed\r\nzinc layer using the aqueous solution method. The influence of various precursor\r\ncompositions on the morphology of the ZnO nanorods, with substrate angles at\r\n0 and 90, was investigated. The various ratios of hexamethylenetetramine in\r\nzinc nitrate hexahydrate were used as precursors in the synthesis of ZnO.\r\nScanning electron micrography indicated that the growth of the ZnO nanorods\r\nwith a 0 substrate angle was smaller than with a 90 substrate angle. The\r\nsubstrate angle is defined as the angle between the plane of the substrate and the\r\nhorizontal layer of an aqueous solution. When the precursor concentration of\r\nhexamethylenetetramine is not equal to the ratio corresponding to the chemical\r\nreaction, the effect of the substrate angle on the diameter size and morphology of\r\nthe ZnO nanorods is evident. Grazing incident X-ray diffraction (GIXRD) was\r\nused to characterize the structure of all samples. The diffraction patterns showed\r\nthat the orientation matched the hexagonal wurtzite structure.',2016,'95','48-54',48,1,'Journal of Mathematical and Fundamental Sciences ','','',1,0,NULL,'2016-09-12 23:33:38',NULL,NULL,0,'2016-09-12 23:33:38',''),('1473759820692',1,0,'Microwave Absorbing Properties of Ba0.6Sr0.4Fe12-zMnzO19 (z = 0 – 3) Materials in XBand Frequencies','Ba0.6Sr0.4Fe12-zMnzO19 (z = 0,1,2, and 3) were successfully synthesized\r\nby solid state reaction through a mechanical milling method. Stoichiometric\r\nquantities of analytical-grade MnCO3, BaCO3, Fe2O3, and SrCO3 precursors with\r\npurity greater than 99% were mixed. It was found that the best phase\r\ncomposition, having an absorber with high performance, was\r\nBa0.6Sr0.4Fe11MnO19. Refinement of the X-ray diffraction patterns revealed that\r\nthe Ba0.6Sr0.4Fe11MnO19 was single-phase and had a hexagonal structure\r\n(P63/mmc). Mechanical milling of Ba0.6Sr0.4Fe11MnO19 powders produced\r\nparticles with a mean size of ~850 nm. SEM images revealed the morphology of\r\nthe particles as being aggregates of fine grains. The magnetic properties of the\r\nBa0.6Sr0.4Fe11MnO19 particles showed a low coercivity and a high remanent\r\nmagnetization. The Ba0.6Sr0.4Fe11MnO19 has certain microwave absorber\r\nproperties in the frequency range of 8-14 GHz, with an absorbing peak value\r\nof -8 dB and -10 dB at frequencies of 8.5 and 12.5 GHz, respectively. The study\r\nconcludes that the Ba0.6Sr0.4Fe12-zMnzO19 that was successfully synthesized is a\r\ngood candidate for use as an electromagnetic absorber material',2016,'95','55-65',48,1,'Journal of Mathematical and Fundamental Sciences','','',1,0,NULL,'2016-09-12 12:43:41',NULL,NULL,0,'2016-09-12 12:43:41',''),('1473826067956',1,0,'Oligocene Cyclic Sedimentation Deduced from Taphonomic Analysis of Molluscs in Lacustrine Deposits of the Pematang Group, Pesada Well, Central Sumatra Basin','The Oligocene cycle of Pesada Well, Central Sumatra Basin,\r\nIndonesia is composed of a deepening-upward series of depositional cycles in a\r\nlacustrine environment affected by oscillations of the water level. Taphonomic\r\nanalysis of gastropod molluscs was used to interpret the cycle architecture of the\r\nBrown Shale (Pematang Group). Four types of shell concentrations were\r\nidentified. The early transgressive deposit has a distinct erosion surface at the\r\nbase, contains concretions, is formed of coarse-grained sediment with abraded\r\nand broken shells, and is interpreted as reworked deposits. The late transgressive\r\ndeposit contains a hiatal concentration formed by continuing lake level rise, with\r\nmany complete shells preserved in life position. The maximum transgressive\r\ndeposit has complete shells in life position or that have been transported, as well\r\nas juvenile molluscs and broken shells. The early regressive deposit contains\r\nalternating shell-rich and shell-poor layers. Since the lacustrine system shows no\r\ntectonic effects and also no marine influenced indications, the seven sedimentary\r\ncycles identified in the Pesada Well are likely to have been affected by\r\noscillations between monsoonal and dry periods.',2016,'95','66-81',48,1,'Journal of Mathematical and Fundamental Sciences ','','',1,0,NULL,'2016-09-13 14:07:48',NULL,NULL,0,'2016-09-13 14:07:48',''),('1473826934913',1,0,'Effect of V Dopant on Physicochemical Properties of Vanadium-Doped Anatase Synthesized via Simple Reflux Technique','Mesoporous pure TiO2 (M-TiO2) and mesoporous-vanadium-doped TiO2\r\n(M-V-doped TiO2) were successfully synthesized via a facile and simple reflux\r\ntechnique. The purpose of this research was to study the effect of vanadium dopant\r\non the physicochemical properties of all materials obtained. Characterization of the\r\nprepared materials was carried out using X-ray diffraction (XRD), scanning electron\r\nmicroscopy-energy dispersive X-ray spectroscopy (SEM-EDS) and N2-adsorptiondesorption\r\nanalysis. The presence of Ti and O elements in M-TiO2 and of Ti, V and\r\nO elements in M-V doped TiO2 could be detected by SEM-EDS, while the patterns\r\nof X-ray diffraction of all the prepared samples had a well-crystalline surface of\r\nanatase type. All mesoporous vanadium-doped TiO2 (M-V-doped TiO2) materials\r\nperformed in a highly transparent mode in the visible region at 554 nm (Eg = 2.24\r\neV) and 588 nm (Eg = 2.12 eV) for 3.3 and 4.9 wt% V doped TiO2, respectively. The\r\nRietveld refinement method was applied to extract the structural parameters of the\r\nM-TiO2 and M-V-doped TiO2 using the Fullprof program in the WinPlotr package.\r\nThe prepared materials were refined in the crystal system and space group of anatase\r\n(tetragonal, I41/amd (141)). The vanadium ion was successfully doped into TiO2.\r\nThe isotherm type of M-TiO2 and 2.3 wt% V doped TiO2 were of type IV, with a\r\nprofile of type H2 hysteresis loops, while the 3.3 and 4.9 wt% vanadium-doped TiO2\r\nreflected isotherm type III. The Brunauer-Emmett-Teller (BET) results showed a\r\nsignificant reduction in surface area due to increased concentrations of vanadium.\r\nThe highest values of BET-specific surface area, pore volume and average pore size\r\nof M-TiO2 were 46 m2/g, 18.45 nm and 0.2572 cm3/g respectively.',2016,'95','82-93',48,1,'Journal of Mathematical and Fundamental Sciences','','',1,0,NULL,'2016-09-13 21:22:15',NULL,NULL,0,'2016-09-13 21:22:15',''),('1473919269130',1,0,'New Seven-Step Numerical Method for Direct Solution of Fourth Order Ordinary Differential Equations','A new numerical method for solving fourth order ordinary differential\r\nequations directly is proposed in this paper. Interpolation and collocation were\r\nemployed in developing this method using seven steps. The use of the\r\napproximated power series as an interpolation equation was adopted in deriving\r\nthe method. The basic properties of the new method such as zero-stability,\r\nconsistency, convergence and order are established. The numerical results\r\nindicate that the new method gives better accuracy than the existing methods\r\nwhen it is applied to fourth ordinary differential equations',2016,'95','94-105',48,2,'Journal of Mathematical and Fundamental Sciences ','','',1,0,NULL,'2016-09-14 23:01:09',NULL,NULL,0,'2016-09-14 23:01:09',''),('1473924117014',1,0,'Multifractal Characterization of Pore Size Distributions of Peat Soil','This paper discusses a multifractal analysis of the microscopic\r\nstructure of peat soil. The aim of this study was to apply the multifractal\r\ntechnique to analyze the properties of five slices of peat soil (L1-L5). Binary\r\nimages (220 x 220 pixels, with a conversion value of 9.41 μm/pixel) were made\r\nfrom the thin slices and then analyzed. This analysis was conducted to obtain the\r\nrelationship between physical parameters and complexity parameters. The results\r\nshowed that the spectrum of f(α) can describe well the pore size distribution and\r\naverage size of pores correlated with the value of D(0). A high value of the\r\naverage pore size is followed by a low D value and vice versa',2016,'95','106-114',48,2,'Journal of Mathematical and Fundamental Sciences ','','',1,0,NULL,'2016-09-15 07:21:57',NULL,NULL,0,'2016-09-15 07:21:57',''),('1473988445127',1,0,'Reconstruction of Sea Surface Temperature Data based on the Sr/Ca of Porites Coral in Ambon Bay','Sea Surface Temperature (SST) data can be used to understand\r\noceanography dynamics in Ambon Bay. However, a lack of continual and long\r\ntime series in-situ SST data limited this study. To overcome this problem, the\r\nSr/Ca composition in Porites coral taken from Outer Ambon Bay was used to\r\nreconstruct SST. The coral sample was sub-sampled monthly and analyzed using\r\nICP-OES. Subsequently, the anchor point method was used to develop the\r\nchronology of the coral Sr/Ca based on ERSST v3b data. The regression\r\nequation results were Sr/Ca = -0.059 x SST + 10.32 (r = -0.699, n = 95, p <\r\n0.05). The reconstructed SST based on these results was verified by in-situ data\r\nfrom May to November 2008. The difference was found to be 1.2-2.5 °C (σ =\r\n0.05%). This results lead us to conclude that coral Sr/Ca reflects SST variation in\r\nAmbon Bay well. Based on the reconstructed SST, we found that the SST in\r\nAmbon Bay experiences an extreme seasonal variation, which is highly\r\ncorrelated to air temperature, wind speed, and length of sun radiation. Ambon\r\nBay also experiences SST anomalies in some periods, which are dominantly\r\naffected by local atmospheric conditions rather than ENSO phenomena',2016,'95','115-129',48,2,'Journal of Mathematical and Fundamental Sciences ','','',1,0,NULL,'2016-09-16 01:14:05',NULL,NULL,0,'2016-09-16 01:14:05',''),('1473990142485',1,0,'Site Response Characteristics of Simeulue Island, Indonesia as Inferred from H/V Spectral Ratio of Ambient Noise Records','Simeulue Island is an outer island arc west of Sumatra Island. The\r\nisland is located close to the interface of the subduction zone between the Indo-\r\nAustralian and Eurasian plates. Seismic activities around the island include\r\ndevastating megathrust earthquakes, such as the 2004 MW 9.2 Sumatra-Andaman\r\nand 2005 MW 8.7 Nias earthquakes. We have investigated site response\r\ncharacteristics using the Horizontal-to-Vertical (H/V) Spectral Ratio method\r\nbased on continuous ambient noise records from eight broadband seismometers.\r\nFrom the calculation results, generally, strong peaks were observed in the H/V\r\nspectral ratio curves caused by strong impedance contrast in this area. However,\r\nthe BATU, LABU and DEHI sites showed relatively flat H/V spectral ratio\r\ncurves caused by a lack of sharp impedance contrast beneath the site. Multiple\r\npeaks were observed at several sites, which may indicate the presence of a more\r\nhighly weathered soil/clay layer on top of a more compact medium. H/V peak\r\nfrequencies, which reveal the fundamental resonant frequencies of the soil sites,\r\nwere generally observed in the range of 2.0 Hz-16.4 Hz',2016,'95','130-142',48,2,'Journal of Mathematical and Fundamental Sciences','','',1,0,NULL,'2016-09-16 01:42:22',NULL,NULL,0,'2016-09-16 01:42:22',''),('1473994243585',1,0,'A Study of Multiple Scattering in BGO and LYSO Single Crystal Scintillators','The angular distribution of multiple Compton scatterings from BGO\r\nand LYSO single crystal scintillators was studied at various scattering angles.\r\nGamma photons with 662 keV energy, acquired from a 137Cs source, were used.\r\nThe scattered photons were detected by a 51mm × 51mm NaI(Tl) scintillation\r\ndetector. The overall energy correlated to the total number of scattered incidents\r\nwas analytically reconstructed. The research found that the multiply scattered\r\nincidents had the same energy as received from the singly scattered distribution,\r\nas the attribution of multiply scattered incidents near the 90° scattering angle\r\nrevealed. The research results were in agreement with the theoretical\r\ncalculations.',2016,'95','143-148',48,2,'Journal of Mathematical and Fundamental Sciences ','','',1,0,NULL,'2016-09-16 02:50:43',NULL,NULL,0,'2016-09-16 02:50:43',''),('1473994713440',1,0,'Production and Characterization of Chitinases from Thermophilic Bacteria Isolated from Prataan Hot Spring, East Java','Thermophilic bacteria producing chitinase were collected from\r\nPrataan hot spring, East Java, Indonesia and screened. The isolated bacterium\r\nwas analyzed using 16S rRNA gene sequencing analysis and identified as\r\nPaenibacillus sp. The molecular identification was confirmed through\r\nmorphological and physiological analyses. The production of chitinase was\r\nconducted at various incubation times, temperatures, pH and concentrations of\r\ncolloidal chitin. The optimum condition of the isolate to produce the highest\r\nchitinase was 0.9% (w/v) of colloidal chitin (pH 7.0) at 48 °C for 24 hours. The\r\nobtained chitinases were optimally active at 55 °C and pH 6.0-7.0. The chitinases\r\nwere gradually purified by ammonium sulfate precipitation, Sephadex G-100 gel\r\nfiltration, followed by DEAE–cellulose ion exchange chromatography (IEC).\r\nThe purification method gave a purification factor of 9.43 and a yield of 2.68%.\r\nTwo protein fractions were obtained from sodium dodecyl sulfatepolyacrylamide\r\ngel electrophoresis (SDS-PAGE) with molecular weights of 68\r\nand 82 kDa.',2016,'95','149-163',48,2,'Journal of Mathematical and Fundamental Sciences ','','',1,0,NULL,'2016-09-16 02:58:33',NULL,NULL,0,'2016-09-16 02:58:33',''),('1473996586829',1,0,'Optimal Vaccination and Treatment Schedules in a Deterministic Avian influenza Model','In this study, a transmission model of the Avian influenza disease was\r\ndeveloped and analyzed in view of optimization of vaccination and medical\r\ntreatment. The model is a host-vector model. We focussed on control of Avian\r\ninfluenza, where a vaccination is given to susceptible poultry, while medical\r\ntreatment is given to infected humans. In the model, the human population is\r\ndivided into four compartments: susceptible humans, infected humans, recovered\r\nhumans, and treated humans. Meanwhile, the poultry population is divided into\r\nthree compartments: susceptible poultry, infected poultry, and vaccinated\r\npoultry. To analyze the dynamical behavior of the model, we obtained the\r\ndisease-free equilibrium, the endemic equilibrium, and the basic reproduction\r\nratio. Furthermore, a model of the optimal vaccination and medical treatment\r\nschedule was constructed to know the optimal strategy for controlling Avian\r\ninfluenza. The model can be used to determine the minimal cost of controlling\r\nthe disease. The model is solved by a genetic algorithm method. Numerical\r\nsimulations showed that effective control of Avian influenza can be achieved\r\nwith a combination of vaccination and medical treatment. Likewise, the optimal\r\nschedule and strategy for controlling Avian influenza are shown',2016,'95','164-177',48,2,'Journal of Mathematical and Fundamental Sciences','','',1,0,NULL,'2016-09-16 03:29:47',NULL,NULL,0,'2016-09-16 03:29:47',''),('1473997772718',1,0,'Antihyperglycemic Activity of Piper crocatum Leaves and Cinnamomum burmannii Bark Mixture Extract in Streptozotocin-induced Diabetic Rats','Indonesia presently has the fourth largest diabetic mellitus prevalence\r\nof all countries in the world. In a previous study, a mixture extract of Piper\r\ncrocatum leaves and Cinnamomum burmannii bark showed in vitro\r\nantihyperglycemic activity. It acted as inhibitor of the -glucosidase enzyme and\r\nhad no toxic effect when it was administered orally to male and female rats for\r\n28 days. In the present study, mixture extracts of P. crocatum leaves and C.\r\nburmannii bark were used to observe antihyperglycemic activity in diabetic rats\r\ninduced with streptozotocin. Mixture extracts of P. crocatum leaves and C.\r\nburmannii bark were orally given to diabetic Sprague Dawley rats at various\r\ndoses for 16 days. The results showed that the treatment led to a reduction of the\r\nblood glucose level, an increase in blood insulin level up to 170.75% at 1260\r\nmg/kg body weight, maintaining the blood lipid level of the diabetic rats at a\r\nnormal level, and an increase of pancreatic ß cells in the islets of Langerhans up\r\nto 2.2-fold at 1260 mg/kg body weight. The mixture extracts of P. crocatum and\r\nC. burmannii have antihyperglycemic activity, which enhances the number of\r\npancreatic β cells',2016,'95','178-191',48,2,'Journal of Mathematical and Fundamental Sciences','','',1,0,NULL,'2016-09-16 03:49:33',NULL,NULL,0,'2016-09-16 03:49:33',''),('1473999026550',1,0,'Some Problems on the Making of Mathematical Modelling of a Profit-Loss Sharing Scheme Using Data Simulation','The mathematical model for a profit-loss sharing scheme is formulated in order to see how this scheme can replace the traditional practice of lending money against high interest by usurers. It is sourced from the musyarakah method in Islamic Syariah law and implemented for small-scale investments of traditional-market traders. They are the common target of usurers, so they may end up poorer than they were before. The main goal of the model is to find the appropriate portion of profit share, so the investment is profitable not only for the investor but also for the trader. There are three main problems in the process of formulating the mathematical model and finding optimized results. The first problem is providing the appropriate amount of data to be implemented in the model. The second problem is determining the objective function for the optimization of the portion of profit share. The last problem is determining the appropriate values of the parameters for certain types of traders. We found a significant result in determining the appropriate values of the parameters that explain the potential capability of the traders in handling larger amounts of capital to be invested in order to achieve our main goal',2015,'95','1-11',47,1,'Journal of Mathematical and Fundamental Sciences','','',1,0,NULL,'2016-09-16 04:10:26',NULL,NULL,0,'2016-09-16 04:10:26',''),('1473999664472',1,0,'Optimal Control of Isometric Muscle Dynamics','We use an indirect optimal control approach to calculate the optimal\r\nneural stimulation needed to obtain measured isometric muscle forces. The\r\nneural stimulation of the nerve system is hereby considered to be a control\r\nfunction (input) of the system ’muscle’ that solely determines the muscle force\r\n(output). We use a well-established muscle model and experimental data of\r\nisometric contractions. The model consists of coupled activation and contraction\r\ndynamics described by ordinary differential equations. To validate our results,\r\nwe perform a comparison with commercial optimal control software',2015,'95','12-30',47,1,'Journal of Mathematical and Fundamental Sciences','','',1,0,NULL,'2016-09-16 04:21:04',NULL,NULL,0,'2016-09-16 04:21:04','');
